const TopMovies = (props) => {
  return (
    <>
      <div className="top-movies">
        <div>
          <h2>{props.videos.name}</h2>
          <img key={props.id} src={props.videos.url} alt={props.id} />
        </div>
      </div>
    </>
  );
};

export default TopMovies;
